import React from 'react';
import { BrowserRouter as Router, Route, Routes} from 'react-router-dom';

import Dashboard from './component/Basics/Dashboard';
import Carousel from './component/Basics/Carousel';

const App = () => {
  return (
    <Router>
    <Dashboard/>
      <Routes>
        <Route path="/arousel" component={Carousel} />
      </Routes>
    </Router>
  );
};

export default App;
